  }
}
.contact-form {
  padding-top: 84px;
  padding-bottom: 84px;
  background-color: #191c26;
}
.form-field {
  display: flex;
  flex-direction: column;
}

.contact-form-title {
  color: #ffffff;
  text-align: center;
  margin-bottom: 44px;
}
.contact-input-wrapper {
  position: relative;
  display: block;
}
.contacts-input {
  position: relative;
  display: block;
  width: 100%;
  height: 24px;
  background-color: transparent;
  border: none;
  border-bottom: 1px solid rgba(157, 164, 189, 0.4);
  font-weight: 600;
  font-size: 11px;
  line-height: 1.36;
  letter-spacing: 0.1em;
  text-transform: uppercase;
  color: #ffffff;
  margin-bottom: 44px;
  // outline: 1px solid red;
  transition: border-bottom-color 250ms linear;
  cursor: pointer;

  &::placeholder {
    color: rgba(157, 164, 189, 0.4);
    transition: color 250ms linear;
  }
  &:focus::placeholder,
  &:hover::placeholder {
    color: #ffffff;
  }

  &:focus,
  &:hover {
    border-bottom-color: #ffffff;
    outline: none;
  }
}

.contacts-input-message {
  resize: none;
  height: 76px;
  &:focus,
  &:hover {
    border-color: #ffffff;
    outline: none;
  }
}

.send-button {
  margin-left: auto;
  margin-right: auto;
  padding: 12px 20px;
  border-radius: 25px;
  min-width: 160px;
  height: 40px;
  font-weight: 600;
  font-size: 12px;
  line-height: 1.33;
  letter-spacing: 0.09em;
  text-transform: uppercase;
  color: #ffffff;
  text-align: center;
  background-color: transparent;
  border: 1px solid #ff6c00;
  cursor: pointer;
  outline: none;
  transition: background-color 250ms linear;

  &:hover,
  &:focus {
    background-color: var(--accent-color);
  }
}

/////////     CONTACT INFO    ////////

.contact-info {
  padding-top: 84px;
  padding-bottom: 84px;
}

.contact-info-title {
  color: #ffffff;
  text-align: center;
  margin-bottom: 40px;
}

.contact-list-item:not(:last-child) {
  margin-bottom: 20px;
}
.contact-list-link {
  display: flex;
  align-items: center;
  font-style: normal;
  font-weight: 400;
  font-size: 18px;
  line-height: 1.67;
  letter-spacing: 0.02em;
  color: #9da4bd;
}
.contact-date {
  font-style: normal;
  font-weight: 400;
  font-size: 18px;
  line-height: 1.67;
  letter-spacing: 0.02em;
  color: #9da4bd;
}
.suptitle {
  display: flex;
  align-items: center;
  font-style: normal;
  font-weight: 600;
  font-size: 11px;
  line-height: 15px;
  letter-spacing: 0.1em;
  text-transform: uppercase;
  color: #ffffff;
  margin-top: 44px;
  margin-bottom: 20px;

  &::before {
    display: inline-block;
    content: '';
    width: 60px;
    height: 1px;
    background: rgba(157, 164, 189, 0.4);
    margin-right: 20px;
  }
}

.contact-icon {
  flex-shrink: 0;
  width: 24px;
  height: 24px;
  margin-right: 20px;
  vertical-align: text-top;
}
.contact-list-icon-map-pin {
  align-self: flex-start;
  margin-top: 4px;
}

@media screen and (min-width: 768px) {
  .contact-form-title {
    text-align: left;
  }
  .contact-input-wrapper {
    display: flex;
  }
  .contacts-input-wrapper {
    width: 330px;
    &:not(:last-child) {
      margin-right: 30px;
    }
  }
  .contact-form {
    padding-top: 100px;
    padding-bottom: 100px;
  }
  .contact-info {
    padding-top: 100px;
    padding-bottom: 100px;
  }

  .contact-info-title {
    text-align: left;
  }
  .send-button {
    margin-left: 0;
  }
  .contact-list {
    max-width: 260px;
  }

  .suptitle {
    margin-top: 0;
  }
  .container-contact-info {
    display: flex;
  }
  .contact-info-addres-wraper {
    width: 50%;
  }
  .contact-date-wraper {
    width: 50%;
  }
}

@media screen and (min-width: 1200px) {
  .contact-wrapper > .container {
    display: flex;
    justify-content: space-between;
  }
  .container-contact-info {
    display: block;
  }
  .contact-form,
  .contact-info {
    padding-top: 130px;
    padding-bottom: 130px;
    width: calc((100% - 30px) / 2);
  }

  .contact-form > .container,
  .contact-info > .container {
    width: 100%;
    padding: 0;
  }

  .form-field {
    width: 560px;
    // padding-left: 15px;
  }

  .contacts-input + .contacts-input {
    margin-right: 30px;
  }

  .contact-list-link {
    display: flex;
    align-items: center;
  }

  .contact-info {
    padding-left: 85px;
  }

  .suptitle {
    margin-top: 44px;
  }
  .contact-form {
    display: flex;
    justify-content: flex-end;
    padding-right: 40px;
  }

  .contact-list-icon-map-pin {
    align-self: flex-start;
    margin-top: 6px;
  }
}

///////   FOOTER    /////////

.footer {
  padding-top: 44px;
  padding-bottom: 44px;
}

.container-footer {
  display: flex;

  // flex-wrap: wrap;
  flex-direction: column-reverse;
  // justify-content: flex-end;
  // // align-items: stretch;
}
.copyright {
