  background-color: transparent;
  color: rgba(157, 164, 189, 0.6);
  border-color: rgba(157, 164, 189, 0.6);
  outline: none;
  transition: color 250ms linear;

  padding-left: 0px;
  padding-right: 12px;
  text-align: left;
  &:focus,
  &:hover {
    color: white;
    border-color: white;
  }
}
