  transition: color 250ms linear;

  padding-left: 0px;
  padding-left: 12px;
  &:focus,
  &:hover {
    color: white;
    border-color: white;
  }
}
.slick-arrow.slick-next:focus,
.slick-arrow.slick-next:hover {
  color: white;
  border-color: white;
}
